import React from 'react';
import logo from './logo.svg';
import './css/App.css';
import './css/main.css';
import './css/contents.css';
import './css/cssset.css';


export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: 'James'
    }
  }

  render() {
    const name = this.state.name;

    return (
      <h1>Hello, {name}.</h1>
    );
  }
}
